char get_bunsi(int ndp,int id)
{
        struct NODE *np;
        int car_len;

        np=&Gnode[ndp];
#ifdef DEBUG1 
        print_1_node(ndp);
        printf("\t:I=%d\n",id);
#endif
        if(np->car > 0)
                car_len=Gnode[np->car].blen;
        else
                car_len=0;

        if(np->blen==-1)
        {                
                if(np->cdr == -1)
                {
                        if(car_len != -1)
                                return(get_bunsi(np->car,id % car_len));
                        else
                                return(get_bunsi(np->car,id));
                }
                else
                {
                        if(car_len > id || car_len== -1)
                                return(get_bunsi(np->car,id));
                        else
                                return(get_bunsi(np->cdr,id-car_len));
                }       
        }
        else
        {
                if(np->blen <= id)
                        return('0');
                if(np->cdr == -1)
                {
                        if(np->car == -1)
                        {
                                if(np->coef > 1) // number*terminal
                                {
                                        return(np->genum[0]);
                                }
                                else             // terminal...
                                        return(np->genum[id]);
                        }
                        else
                                return(get_bunsi(np->car,id % car_len));
                }
                if(car_len > id)
                        return(get_bunsi(np->car,id));
                else
                        return(get_bunsi(np->cdr,id-car_len));
        }
}
